import React from "react";
import Presentacion from "../../components/Presentacion"; // Ruta correcta al componente Presentacion
import BannerIntroducción from "../../components/BannerIntroducción"; // Componente de introducción con temática marina
import ProyectosCard from "../../components/ProyectosCard"; // Componente de proyectos recientes

const Home = () => {
    return (
        <div className="container">
            {/* Renderiza la sección de presentación */}
            <Presentacion />

            {/* Renderiza el banner de introducción */}
            <BannerIntroducción />

            {/* Renderiza una tarjeta de proyectos */}
            <div className="proyectos-section">
                <ProyectosCard
                    title="Proyecto 1: Sistema de Gestión"
                    description="Un sistema avanzado para la gestión de tareas y equipos."
                    link="https://github.com/tu-proyecto"
                />
                <ProyectosCard
                    title="Proyecto 2: Portafolio Personal"
                    description="Un portafolio con una temática marina única."
                    link="https://github.com/tu-proyecto"
                />
            </div>

            {/* Enlace para ir a otra página */}
            <a className="btn-iniciar" href="/main">
                Iniciar
            </a>
        </div>
    );
};

export default Home;
